  true,\n\t\"url\": null,\n\t\"notes\": \"The SORCE SOLSTICE Far-UV Solar Spectral
  Irradiance (SSI) data product SOR3SOLFUVD is constructed using measurements from
  the SOLSTICE FUV instrument, which are combined into merged daily solar spectra
  over the spectral range from 115 to 180 nm at a spectral resolution of 1 nm. Irradiances
  are reported at a mean solar distance of 1 AU and zero relative line-of-sight velocity
  with respect to the Sun. The SOLSTICE absolute uncertainty better than 5%.nnAll
  of the SOR3SOLFUVD data are arranged in a single file in a tabular ASCII text file
  which can be easily read into a spreadsheet application. The columns contain the
  date, Julian day, minimum wavelength, maximum wavelength, instrument mode, data
  version number, irradiance value, irradiance uncertainty, and data quality. The
  rows are arranged with data at each wavelength over the full SOLSTICE FUV wavelength
  range, repeating for each day for the length of the measurement period.\",\n\t\"license_title\":
